What does happiness mean to you? Are you genuinely happy? 

I have gone through countless ups and downs this year and struggled with feeling truly settled and at home in my own skin. Anyone else? 👋🏽

I woke up one day and decided to be done. Done with saying yes to things I didn’t agree with. Done with losing sleep and time with loved ones. Done compromising my own beliefs to please others. And fucking done keeping quiet and holding in my thoughts and emotions. 

It was on the same day I had a vision for myself and for my future. Being my own boss, an entrepreneur and a strong woman leader is step 1. 

“Wildflower” embodies my truest self, a free-spirit and a deeply passionate and independent woman. “Bravely growing wild and free in a world plagued by conformity” as Urban Dictionary so eloquently put it. But I didn’t always have this strength. Honestly, there are some days I still don’t have it.

The beautiful thing about wildflowers though, are that they continue to grow and thrive in even the most unconventional, broken places. They weather storms big and small. They pick themselves up from the ground after heavy rain because they drink in their past and gain strength from it!

Now I have the ability to build a strong community and take it with me wherever I go. The passion I feel to wake up and serve a community I have created is SO STRONG!

I am so grateful for each and every one of you. You are part of the community I am trying to grow and part of the “roots” I’m planting for a happy future.

What is your step 1 for creating happiness in your life? 👇🏼👇🏼👇🏼👇🏼 Let me know in the comments 💕

